import React from "react";
import {
  Slider,
  RadioGroup,
  FormControlLabel,
  Radio,
  TextField,
  Pagination,
} from "@mui/material";
import JobList from "./JobList";
import MainHeader from "./MainHeader";
import styles from "./styles/SearchPage.module.scss";

const SearchPageTemplate = () => {
  return (
    <div>
      <MainHeader />
      <div className={styles["main-content"]}>
        <div className={styles["job-filters"]}>
          <fieldset className={styles["job-category-filter"]}>
            <legend className={styles["job-filter-legend"]}>
              Filter Jobs By Category
            </legend>
            <RadioGroup
              name="job-categories-radio-buttons-group"
              defaultValue="All Categories"
            >
              {/* Dummy categories for display */}
              <FormControlLabel
                value="Category1"
                control={<Radio />}
                label="Category 1"
                key="Category1"
              />
              <FormControlLabel
                value="Category2"
                control={<Radio />}
                label="Category 2"
                key="Category2"
              />
            </RadioGroup>
          </fieldset>
          <fieldset className={styles["job-salary-filter"]}>
            <legend className={styles["job-filter-legend"]}>
              Filter Jobs By Salary Range
            </legend>
            <Slider
              min={30000}
              max={150000}
              step={1000}
              marks={[
                {
                  value: 30000,
                  label: "$30k",
                },
                {
                  value: 150000,
                  label: "$150k",
                },
              ]}
              value={[50000, 100000]}
              valueLabelDisplay="auto"
              valueLabelFormat={(value) => `$${value / 1000}k`}
            />
          </fieldset>
          <fieldset className={styles["job-keyword-filter"]}>
            <legend className={styles["job-filter-legend"]}>
              Filter Jobs By Description
            </legend>
            <TextField
              label="Description"
              variant="filled"
            />
          </fieldset>
        </div>
        <div className={styles["job-list"]}>
          {/* Dummy content */}
          <JobList jobs={[]}></JobList>
          <div className={styles["pagination-container"]}>
            <Pagination
              count={10}
              variant="outlined"
              shape="rounded"
              size="large"
              showFirstButton
              showLastButton
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default SearchPageTemplate;
